import React from 'react';
import './App.css';

const App = () => {

  return (
    <div>
      <header>
        <img src="https://images.fineartamerica.com/images/artworkimages/mediumlarge/2/no-bad-days-rinri-ive.jpg"/>
      </header>
      <nav>
        <div>Profile</div>
        <div>Messages</div>
      <div>News</div>
      <div>Music</div>
    </nav>
    <div>Main contend</div>
    </div>
  );
}


export default App;
